%[text] %[text:anchor:T_9CEF1D44] # Pulse shaping design
%[text] This code plots the impulse response and the spectrum of Raised Cosine and Root Raised Cosine filters that will be used for pulse shaping in the next Matlab lessons.
%[text:tableOfContents]{"heading":"**Table of Contents**"}
clc;                                        % Clear the command window screen %[text:anchor:H_EB4B9370]
clear all;                                  % Erase all existing variables,functions, and scripts
close all;                                  % Close all figure windows
%[text] %[text:anchor:H_C3AA43E0] ## Guidelines: what to do?
%[text] %[text:anchor:H_F575ECB7] The goal it to develop the missing code in the following function:
%[text] - raised\_cosine \
%[text] Once the function is completed, observe and understand the influence of the input parameters on the filter impulse response and its spectrum.
%[text] **Tips:** the function already exists in Matlab, you can therefore observe the final result you should reach. You can also compare both the inbuilt Matlab function and your function to see whether it fits or not. 
%[text] %[text:anchor:H_02396945] ## Input parameters of the filter
rolloff = .2 ;                               % Roll-off factor
sps = 4 ;                                    % Number of samples per symbol
span = 16 ;                                  % Span of the pulse shaping filter
%[text] %[text:anchor:H_D42DEA8C] ## Raised Cosine Filter
g = raised_cosine( rolloff , span , sps , 'normal' ) ;          % Raised Cosine Pulse to design %[text:anchor:H_90F66E51]
g_test = rcosdesign( rolloff  , span, sps , 'normal' ) ;        % Raised Cosine Reference (designed by Matlab)
%[text] %[text:anchor:H_7888245F] ### RC Impulse Response (IR) plot
figure %[output:606b8593]
title( 'RC Impulse Response' ) %[output:606b8593]
hold on %[output:606b8593]
grid on %[output:606b8593]
stem( g  , 'xr' ) %[output:606b8593]
stem( g_test ) %[output:606b8593]
xlabel('Index') %[output:606b8593]
ylabel('g_{RC}(t)') %[output:606b8593]
%[text] %[text:anchor:H_83895B02] ### RC Spectrum plot
figure %[text:anchor:H_2475FB0E] %[output:82fbe25e]
title( 'RC Spectrum' ) %[output:82fbe25e]
hold on %[output:82fbe25e]
grid on %[output:82fbe25e]
plot( abs( fftshift( fft( g ) ) ) ) %[output:82fbe25e]
xlabel('Index') %[output:82fbe25e]
ylabel('|G_{RC}(f)|') %[output:82fbe25e]
%[text] %[text:anchor:H_E9D0A93A] ## Root Raised Cosine Filter
g = raised_cosine( rolloff , span , sps , 'sqrt') ;         % Root Raised Cosine Pulse to design %[text:anchor:H_748AF412]
g_test = rcosdesign( rolloff  , span, sps , 'sqrt' ) ;      % Root Raised Cosine Reference (designed by Matlab)
%[text] %[text:anchor:H_9E0B3AF1] ### RRC Impulse Response (IR) plot
figure %[output:9c8b05b4]
title( 'RRC Impulse Response' ) %[output:9c8b05b4]
hold on %[output:9c8b05b4]
grid on %[output:9c8b05b4]
stem( g  , 'xr' ) %[output:9c8b05b4]
stem( g_test ) %[output:9c8b05b4]
xlabel('Index') %[output:9c8b05b4]
ylabel('g_{RRC}(t)') %[output:9c8b05b4]
%[text] %[text:anchor:H_94733CE5] ### RRC Spectrum plot
figure %[text:anchor:H_2475FB0E] %[output:1478bddf]
title( 'RRC Spectrum' ) %[output:1478bddf]
hold on %[output:1478bddf]
grid on %[output:1478bddf]
plot( abs( fftshift( fft( g ) ) ) ) %[output:1478bddf]
xlabel('Index') %[output:1478bddf]
ylabel('|G_{RRC}(f)|') %[output:1478bddf]
